import PropTypes from "prop-types";

export const Rest = ({
  next,
  prev,
  selectedWorkout,
  completedWorkouts,
  setCompletedWorkouts,
  currentWorkoutSets,
  setCurrentWorkoutSets,
}) => {
  console.log(
    next,
    prev,
    selectedWorkout,
    completedWorkouts,
    setCompletedWorkouts,
    currentWorkoutSets,
    setCurrentWorkoutSets
  );
  return (
    <div className="d-inline-block pt-5">step 4/6 - rest time + initial</div>
  );
};

Rest.propTypes = {
  next: PropTypes.func,
  prev: PropTypes.func,
  selectedWorkout: PropTypes.object,
  completedWorkouts: PropTypes.array,
  setCompletedWorkouts: PropTypes.func,
  currentWorkoutSets: PropTypes.number,
  setCurrentWorkoutSets: PropTypes.func,
};
